const CLIENT_ID = `${process.env.REACT_APP_API_KEY}`;
const REDIRECT_URI = "http://localhost:3000/main";

export const KAKAO_AUTH_URL = `https://kauth.kakao.com/main/authorize?client_id=${CLIENT_ID}&redirect_uri=${REDIRECT_URI}&response_type=code`;
